import React from 'react';
import { Skeleton } from '@mui/material';

function Loading() {
	return (
		<>
			<Skeleton
				variant='rectangular'
				height={40}
				width={200}
				style={{ marginBottom: '5px', borderRadius: '20px' }}
			/>
			<Skeleton
				variant='rectangular'
				height={40}
				width={150}
				style={{ marginBottom: '5px', borderRadius: '20px' }}
			/>
			<Skeleton
				variant='rectangular'
				height={40}
				width={120}
				style={{ marginBottom: '5px', borderRadius: '20px' }}
			/>
			<Skeleton
				variant='rectangular'
				height={40}
				width={170}
				style={{ marginBottom: '5px', borderRadius: '20px' }}
			/>
			<Skeleton
				variant='rectangular'
				height={40}
				width={110}
				style={{ marginBottom: '5px', borderRadius: '20px' }}
			/>
		</>
	);
}

export default Loading;
